import React from 'react';
import Header from './Header';

function App(){
    return(
        <div className='container'>
            <Header />
            <div className="navbar">
                <a href='html'>html</a> |
                <a href='css'>css</a> |
                <a href='javascript'>javascript</a>  | 
                <a href='jquery'>jquery</a>  
            </div>
            <h1>test</h1>
            <ul>
                <li>facebook</li>
                <li>youtube</li>
                <li>instagram</li>
            </ul>
        </div>
    );
}
export default App;
